import React from 'react'
import TodoList from './Todo/TodoList'

function App() {
  const todos = [
    {id: 1, completed: false, title: 'Sounds great!'},
    {id: 2, completed: false, title: 'Sounds cool!'},
    {id: 3, completed: false, title: 'Sounds perfect!'},
  ]

  return (
    <div className='wrapper'>
      <h1> React moviedb</h1>

      <TodoList todos={todos}/>
    </div>
  );
}

export default App
